import BasicLayout from "@/layouts/BasicLayout";
import { Navigate } from "react-router-dom";
import type { RouteObject } from "react-router-dom";
import UserLayout from "@/layouts/UserLayout";
import { lazy } from "react";

const Login = lazy(() => import("@/pages/login"));
const Dashboard = lazy(() => import("@/pages/dashboard"));
const Users = lazy(() => import("@/pages/permission/users"));
const Roles = lazy(() => import("@/pages/permission/roles"));
const Resources = lazy(() => import("@/pages/permission/resources"));
const CategoryTypes = lazy(() => import("@/pages/category/categoryType"));
const Categories = lazy(() => import("@/pages/category/categories"));

export const routes: RouteObject[] = [
  {
    path: "/login",
    element: <UserLayout />,
    children: [
      {
        path: "",
        element: <Login />,
      },
    ],
  },
  {
    path: "/",
    element: <BasicLayout />,
    children: [
      {
        path: "",
        element: <Navigate to="/dashboard" replace />,
      },
      {
        path: "dashboard",
        element: <Dashboard />,
      },
      {
        path: "permission",
        children: [
          {
            path: "users",
            element: <Users />,
          },
          {
            path: "roles",
            element: <Roles />,
          },
          {
            path: "resources",
            element: <Resources />,
          },
        ],
      },
      {
        path: "category",
        children: [
          {
            path: "types",
            element: <CategoryTypes />,
          },
          {
            path: "list",
            element: <Categories />,
          },
        ],
      },
    ],
  },
  {
    path: "*",
    element: <Navigate to="/404" replace />,
  },
];
